import React from 'react'
import { Link } from 'react-router-dom'
import './Slide.css'

const Slide = (props) => {
  return (
    <div className='slide'>
        <Link to={props.url} target={ props.isNewPage ? "_blank" : "_self"}>
            <img src={props.image} alt="" />
        </Link>
    </div>
  )
}

export default Slide
